function rolesubmitForm(){var a={"role_name":$("#role_name_add").val(),"menuitem":$("#menuitem_add").val(),"roleDesc":$("#roleDesc_add").val()};if(a.role_name==""){$.messager.alert("提示","角色名称不能为空");return}if(a.menuitem==""){$.messager.alert("提示","菜单路径不能为空");return}console.log(a);$.ajax({url:ws_url+"/rest/roles/addrole?token="+gtoken,contentType:"application/json;charset=UTF-8",type:"post",datatype:"json",data:JSON.stringify(a),cache:false,success:function(b){console.log(b.status);console.log(b.message);$("#form1").form("clear");if(b.status=="success"){$.messager.alert("提示","添加成功！","info",function(){$("#roleadd").window("close");$("#rolegrid").datagrid("reload")})}else{if(b.status=="failure"){if(b.message=="ERROR_ROLES_EXISTS"){$.messager.alert("提示","数据已经存在,添加失败！","warning",function(){$("#roleadd").window("close");$("#rolegrid").datagrid("reload")})}else{$.messager.alert("提示","添加失败！","error",function(){$("#roleadd").window("close");$("#rolegrid").datagrid("reload")})}}}},error:function(b){console.log(b)}})};